//44 plays on Saturday, February 7. Show runs from 7:00-10:30 at a venue in Chinatown (location revealed day of show).

//44 (DJ set) is Annie Ng. Traversing the kaleidoscopic realms of ambient, illbient, and ethereal choral, her sets are always compelling passages into hypnagogic realms. As the curator of the Fountains event series, she has brought acts such as James K, Flora Yin-Wong, and Hesaitix.

As ever, you can find the ticket link in my bio. 

